function IfTested(e,s){if(e&&s){let e=document.querySelector(".finish"),s=Math.round(5.3*localStorage.getItem("last_results"));e.innerHTML=`<div class="quiz-view">\n                        <div class="result_info">\n                            <p>Ваш iq равен </p>\n                            <div class="last_result">${s}</div>\n                            \n                            <div class="info_about_result">${function(e){let s;switch(!0){case e<=65:s='<p class="render_result_info"> Ваш результат ниже 65, что является чрезвычайно низким и говорит о том, что у человека проходившего IQ тест умственная отсталость. Как правило такие люди не могут самостоятельно жить и у них возникают трудности с повседневными задачами.</p>';break;case 66<=e&&e<=79:s='<p class="render_result_info">Граничный низкий результат, который свидетельствует, что у человека существуют проблемы с вниманием, памятью, рассуждениями, возникают трудности с решением математических и логических задач. Несмотря на это, человек способен вести самостоятельный образ жизни, решать повседневные задачи на уровне с другими людьми.</p>';break;case 80<=e&&e<=89:s='<p class="render_result_info">Нижняя граница среднего результата. Данный результат является нормальным для человека. Как правило легкие вопросы решаются без проблем. Также преодолеваются и вопросы средней сложности. Могут быть ошибки из-за потери концентрации или невнимательности. Более сложный вопросы как правило человек пропускает либо решает слишком долго, теряя много времени.</p>';break;case 90<=e&&e<=110:s='<p class="render_result_info">Среднестатистический уровень IQ для человека. В этих пределах находиться интеллектуальные способности более 50% всех людей.';break;case 111<=e&&e<=120:s='<p class="render_result_info">Верхняя граница среднего результата. Данный результат хорошим результатом для человека. Как правило легкие и средние вопросы решаются без проблем. Трудности возникают со сложными вопросами.</p>';break;case 121<=e&&e<=130:s='<p class="render_result_info">Высокий результат при прохождении IQ теста. Часто таких людей называют одаренными. Легкий, средние и большинство сложных вопросов решаются без каких либо проблем.</p>';break;case e>=131:s='<p class="render_result_info">Очень высокий, который можно получить при тестировании уровня интеллекта. Таких называют гениями. Для них не возникают трудностей решить задачи IQ теста. Как правило они справляются с решением теста раньше указанного времени.\n            Многие люди с подобным уровнем IQ достигают значительных результатов в различных сферах жизни. Таких людей около 2,2%. Самые высокие результаты могут быть у немногих. К примеру у людей, которые получают оценку выше 145 всего 0,2%.</p>'}return s}(Math.round(5.3*localStorage.getItem("last_results")))}</div>\n                        </div>\n                    <div><hr>`,e.innerHTML+=`<img src="${localStorage.getItem("picture")}" class="result_img">`}}IfTested(localStorage.getItem("picture"),localStorage.getItem("last_results"));